import React, { useState } from "react";
import "../../styles/flowTwo/StepOne2.css";
import Header from "../UserFlowOne/Header";
import Footer from "../UserFlowTwo/Footer";
import { vehicleMakes } from "../../constants/vehicleMakes";
import { vehicleModels } from "../../constants/vehicleModels";
import { vehicleTypes } from "../../constants/vehicleTypes";

const StepOne2 = ({ nextStep }) => {
  const [vehicles, setVehicles] = useState([
    {
      year: "",
      make: "",
      model: "",
      type: "",
      ownership: "Owned (not making loan payments)",
      mileage: "10,000 miles",
      primaryUse: "Commute to Work",
    },
  ]);

  const handleVehicleChange = (index, e) => {
    const { name, value } = e.target;
    setVehicles((prevVehicles) =>
      prevVehicles.map((vehicle, i) =>
        i === index ? { ...vehicle, [name]: value } : vehicle
      )
    );
  };

  const addAnotherVehicle = () => {
    setVehicles([
      ...vehicles,
      {
        year: "",
        make: "",
        model: "",
        type: "",
        ownership: "Owned (not making loan payments)",
        mileage: "10,000 miles",
        primaryUse: "Commute to Work",
      },
    ]);
  };

  const handleSubmit = () => {
    // Validation can be added here
    nextStep(vehicles);
  };

  return (
    <div>
      <Header />
      <div className="vehicle-details-container">
        <h2>Get the Best Rates in Your Area!</h2>
        <p>
          Get your quote in just 3 simple steps. Enter your information below.
        </p>

        {vehicles.map((vehicle, index) => (
          <div key={index} className="form-section">
            <div className="section-header">
              <span className="section-number">{index + 1}</span>
              <h3>About Your Vehicle {index + 1}</h3>
            </div>

            <label htmlFor={`year-${index}`}>Vehicle Year</label>
            <select
              id={`year-${index}`}
              name="year"
              value={vehicle.year}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="">Please Select</option>
              {Array.from(
                new Array(71),
                (_, i) => new Date().getFullYear() - i
              ).map((year) => (
                <option key={year} value={year}>
                  {year}
                </option>
              ))}
            </select>

            <label htmlFor={`make-${index}`}>Vehicle Make</label>
            <select
              id={`make-${index}`}
              name="make"
              value={vehicle.make}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="">Please Select</option>
              {vehicleMakes.map((make) => (
                <option key={make} value={make}>
                  {make}
                </option>
              ))}
            </select>

            <label htmlFor={`model-${index}`}>Vehicle Model</label>
            <select
              id={`model-${index}`}
              name="model"
              value={vehicle.model}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="">Please Select</option>
              {(vehicleModels[vehicle.make] || []).map((model) => (
                <option key={model} value={model}>
                  {model}
                </option>
              ))}
            </select>

            <label htmlFor={`type-${index}`}>Vehicle Type</label>
            <select
              id={`type-${index}`}
              name="type"
              value={vehicle.type}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="">Please Select</option>
              {(vehicleTypes[vehicle.model] || []).map((type) => (
                <option key={type} value={type}>
                  {type}
                </option>
              ))}
            </select>

            <label htmlFor={`ownership-${index}`}>
              Is this vehicle owned, financed, or leased?
            </label>
            <select
              id={`ownership-${index}`}
              name="ownership"
              value={vehicle.ownership}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="Owned (not making loan payments)">
                Owned (not making loan payments)
              </option>
              <option value="Financed (making loan payments)">
                Financed (making loan payments)
              </option>
              <option value="Leased">Leased</option>
            </select>

            <label htmlFor={`mileage-${index}`}>
              What is the average annual mileage for this vehicle?
            </label>
            <select
              id={`mileage-${index}`}
              name="mileage"
              value={vehicle.mileage}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              {[
                "5,000 miles",
                "7,500 miles",
                "10,000 miles",
                "12,500 miles",
                "20,000 miles",
                "25,000 miles",
                "30,000 miles",
                "40,000 miles",
                "50,000 miles",
              ].map((mileage) => (
                <option key={mileage} value={mileage}>
                  {mileage}
                </option>
              ))}
            </select>

            <label htmlFor={`primaryUse-${index}`}>
              What is the primary use for this vehicle?
            </label>
            <select
              id={`primaryUse-${index}`}
              name="primaryUse"
              value={vehicle.primaryUse}
              onChange={(e) => handleVehicleChange(index, e)}
            >
              <option value="Commute to Work">Commute to Work</option>
              <option value="Personal Use">Personal Use</option>
              <option value="Business">Business</option>
            </select>
          </div>
        ))}

        <button className="add-vehicle-button" onClick={addAnotherVehicle}>
          + Add Another Vehicle (Optional)
        </button>
        <button className="next-step-button" onClick={handleSubmit}>
          Next Step
        </button>
      </div>
      <Footer />
    </div>
  );
};

export default StepOne2;
